interface Props {
  formType: "signup" | "login";
}

const AuthForm: React.FC<Props> = ({ formType }) => {
  return (
    <React.Fragment>
      <div className="auth-form-container">
        <h1>Signup</h1>
      </div>

      <style jsx>{`
        .auth-form-container {
          width: 100%;
          height: calc(100vh - 40px);
          border: 1px solid red;
        }
      `}</style>
    </React.Fragment>
  );
};

export default AuthForm;
